function getFilePathExtension(path) {
    var filename = path.split('\\\\').pop().split('/').pop();
    var lastIndex = filename.lastIndexOf(".");
    if (lastIndex < 1) return "";
    return filename.substr(lastIndex + 1);
}

function extensionImage(file, el) {
    let docs = ['doc', 'docx', 'pdf'];
    let extension = getFilePathExtension(file);
    var image = file;

    if (docs.indexOf(extension) > -1) {
        el.css("object-fit", "contain");
        switch (extension) {
            case 'pdf':
                image = 'data:image/png;base64,';
                break;
            case 'doc':
            case 'docx':
                image = 'data:image/png;base64,';
                break;
        }
    }

    return image;
}

function media_file(el, preview, image, path) {
    el.find(":hidden").val("");
    el.find(":hidden:eq(0)").val(path || image);
    el.find(":hidden:eq(1)").val(image);
    el.find("img").attr("src", extensionImage(image, el.find("img")));
    preview.addClass("chosen");
}

function media_link(el, preview) {
    let url = prompt("Image or Video ( youtube, vimeo )");
    if (url) {
        el.find("img").attr("src", load_image);
        el.find("img").parents(".media-preview").removeClass('bg-light');
        setTimeout(function () {
            $.post(url_image, { _token: csrf_token, url: url })
                .done(function (response) {
                    media_file(el, preview, response.image, response.path);
                    el.find("img").parents(".media-preview").addClass('bg-light');
                })
                .fail(function () {
                    alert("Media not read");
                })
        }, 1000);
    } else {
        el.parents("li").remove()
    }
}

function gallery_select(name, data) {
    let length = $("#" + name).children("li").length;

    for (var i in data) {
        let html = $("<li/>", { class: "item" }).html($(gallery_item_html));

        html.find(".desktop img").attr("src", extensionImage(data[i].desktop.image, html.find(".desktop img")));

        html.find(".desktop :hidden:eq(0)").attr("name", name + "[" + length + "][desktop][path]").val(data[i].desktop.path);
        html.find(".desktop :hidden:eq(1)").attr("name", name + "[" + length + "][desktop][image]").val(data[i].desktop.image);
        html.find(".desktop :hidden:eq(2)").attr("name", name + "[" + length + "][desktop][title]").val(data[i].desktop.title);
        html.find(".desktop :hidden:eq(3)").attr("name", name + "[" + length + "][desktop][alt]").val(data[i].desktop.alt);
        html.find(".desktop :hidden:eq(4)").attr("name", name + "[" + length + "][desktop][id]").val(data[i].desktop.id);

        html.find(".mobile :hidden:eq(0)").attr("name", name + "[" + length + "][mobile][path]").val(data[i].mobile.path);
        html.find(".mobile :hidden:eq(1)").attr("name", name + "[" + length + "][mobile][image]").val(data[i].mobile.image);
        html.find(".mobile :hidden:eq(2)").attr("name", name + "[" + length + "][mobile][title]").val(data[i].mobile.title);
        html.find(".mobile :hidden:eq(3)").attr("name", name + "[" + length + "][mobile][alt]").val(data[i].mobile.alt);
        html.find(".mobile :hidden:eq(4)").attr("name", name + "[" + length + "][mobile][id]").val(data[i].mobile.id);

        $("#" + name).append(html);
        length++;
    }
}

function responsive_filemanager_callback(field_id) {
    let field = $("#" + field_id), value = field.val();
    let multiple = /^[\],:{}\s]*$/.test(value.replace(/\\["\\\/bfnrtu]/g, '@').
    replace(/"[^"\\\n\r]*"|true|false|null|-?\d+(?:\.\d*)?(?:[eE][+\-]?\d+)?/g, ']').
    replace(/(?:^|:|,)(?:\s*\[)+/g, ''));
    let data = multiple ? JSON.parse(value) : [ value ];

    if (field.parents(".form-group").hasClass("media-single")) {

        let device = [ "desktop", "mobile" ];
        for (var i in data) {
            let preview = $("#" + field_id.replace("-file", ""));
            let el = preview.children("." + device[i]);
            media_file(el, preview, data[i]);
            if  (device[i] === "mobile") {
                el.removeClass("d-none");
            }
        }

    } else if(field.parents(".form-group").hasClass("media-gallery")) {

        let items = [];

        for (var i in data) {
            items[i] = {
                desktop: { path: data[i], image: data[i], title: "", alt: "" },
                mobile: { path: "", image: "", title: "", alt: "" }
            };
        }

        gallery_select(field_id.replace("-file", ""), items);

    } else {

        let el = field.parents(".media-box");
        let preview = el.find(".media-preview");
        media_file(el, preview, data[0]);

    }
}

$(document).ready(function () {

    $("body").on("click", ".media-preview .delete", function () {
        let media = $(this).parents(".media-preview");
        if (media.parents(".media-gallery").length) {
            media.parent().remove();
        } else {
            media.children(".mobile").addClass("d-none");
            media.find("img").attr("src", none_image);
            media.find(":hidden").val("");
            media.removeClass("chosen");
        }
    });

    $("body").on("click", ".media-preview .update", function () {
        let el = $(this).parents(".media-preview");
        let dialog = $(media_dialog_html);
        let desktop_hidden = el.find(".desktop :hidden");
        let mobile_hidden = el.find(".mobile :hidden");

        dialog.find("img:eq(0)").attr("src", extensionImage(desktop_hidden.eq(1).val() || none_image, dialog.find("img:eq(0)")));
        if (desktop_hidden.eq(1).val()) {
            dialog.find("img:eq(0)").parent().addClass("chosen");
        }

        dialog.find("img:eq(1)").attr("src", extensionImage(mobile_hidden.eq(1).val() || none_image, dialog.find("img:eq(1)")));
        if (mobile_hidden.eq(1).val()) {
            dialog.find("img:eq(1)").parent().addClass("chosen");
        }

        dialog.find("#dialog-desktop-path").val(desktop_hidden.eq(0).val());
        dialog.find("#dialog-desktop-image").val(desktop_hidden.eq(1).val());
        dialog.find("#dialog-desktop-title").val(desktop_hidden.eq(2).val()).attr("placeholder", "Balk");
        dialog.find("#dialog-desktop-alt").val(desktop_hidden.eq(3).val()).attr("placeholder", " Aklama");

        dialog.find("#dialog-mobile-path").val(mobile_hidden.eq(0).val());
        dialog.find("#dialog-mobile-image").val(mobile_hidden.eq(1).val());
        dialog.find("#dialog-mobile-title").val(mobile_hidden.eq(2).val()).attr("placeholder", " Balk");
        dialog.find("#dialog-mobile-alt").val(mobile_hidden.eq(3).val()).attr("placeholder", " Aklama");

        (async  function() {
            const {value: data} = await  Swal.fire({
                title: "Media Gncelle",
                html: dialog,
                preConfirm: () => {
                    return {
                        desktop: {
                            path: document.getElementById("dialog-desktop-path").value,
                            image: document.getElementById("dialog-desktop-image").value,
                            title: document.getElementById("dialog-desktop-title").value,
                            alt: document.getElementById("dialog-desktop-alt").value
                        },
                        mobile: {
                            path: document.getElementById("dialog-mobile-path").value,
                            image: document.getElementById("dialog-mobile-image").value,
                            title: document.getElementById("dialog-mobile-title").value,
                            alt: document.getElementById("dialog-mobile-alt").value
                        }
                    }
                }
            });

            if (data) {

                el.find(".desktop :hidden:eq(0)").val(data.desktop.path);
                el.find(".desktop :hidden:eq(1)").val(data.desktop.image);
                el.find(".desktop :hidden:eq(2)").val(data.desktop.title);
                el.find(".desktop :hidden:eq(3)").val(data.desktop.alt);
                el.find(".desktop img").attr("src", extensionImage(data.desktop.image, el.find(".desktop img")));

                el.find(".mobile :hidden:eq(0)").val(data.mobile.path);
                el.find(".mobile :hidden:eq(1)").val(data.mobile.image);
                el.find(".mobile :hidden:eq(2)").val(data.mobile.title);
                el.find(".mobile :hidden:eq(3)").val(data.mobile.alt);

                let mobile = el.find(".mobile");
                if (data.mobile.image) {
                    mobile.removeClass("d-none");
                    if (data.mobile.image != el.find(".mobile :hidden:eq(1)").val()) {
                        mobile.animateCss("zoomIn faster");
                    }
                    el.find(".mobile img").attr("src", extensionImage(data.mobile.image, el.find(".mobile img")));
                } else {
                    mobile.animateCss("zoomOut faster", function () {
                        el.find(".mobile img").attr("src", extensionImage(data.mobile.image, el.find(".mobile img")));
                        mobile.addClass("d-none");
                    });
                }

                if (!data.desktop.image) {
                    if (el.parents("ul").hasClass("gallery")) {
                        el.parent().remove();
                    } else {
                        mobile.addClass("d-none");
                        el.removeClass("chosen");
                        el.find(":hidden").val("");
                        el.find("img").attr("src", none_image);
                    }
                }

            }
        })();
    });

    $("body").on("click", ".media-link", function () {
        let el = $(this).parents(".media-box");
        media_link(el, el.children(".media-preview"));
    });

});
